import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the Cart element (using text and class)
    const cartSelector = "//div[contains(@class,'cart') and contains(normalize-space(),'Cart')]";
    await page.waitForSelector(cartSelector, { timeout: 5000 });

    // Take screenshot before clicking cart
    const beforeCartClick = path.join(screenshotsDir, 'step_2_before_cart_click.png');
    await page.screenshot({ path: beforeCartClick });
    screenshots.push(beforeCartClick);

    // Click the Cart element using XPath
    const cartDiv = await page.$(cartSelector);
    if (!cartDiv) throw new Error('Cart element not found');
    await cartDiv.click();

    // Wait for the cart modal to appear (by id or class, using multiple strategies)
    let cartModal = null;
    try {
      await page.waitForSelector('#cartModal', { timeout: 5000 });
      cartModal = await page.$('#cartModal');
    } catch {
      // Try alternative selector by class and heading
      await page.waitForSelector("//div[contains(@class,'modal') and .//h2[contains(text(),'Cart')]]", { timeout: 5000 });
      cartModal = await page.$("//div[contains(@class,'modal') and .//h2[contains(text(),'Cart')]]");
    }

    // Take screenshot after modal opens
    const afterCartModal = path.join(screenshotsDir, 'step_3_cart_modal_open.png');
    await page.screenshot({ path: afterCartModal });
    screenshots.push(afterCartModal);

    // Extract cart modal visible state and heading text
    let cartModalVisible = false;
    let cartModalHeading = '';
    if (cartModal) {
      cartModalVisible = await cartModal.isVisible ? await cartModal.isVisible() : true;
      const headingEl = await cartModal.$('h2');
      if (headingEl) {
        cartModalHeading = (await headingEl.innerText()).trim();
      }
    }

    return {
      success: true,
      action: "Opened the shopping cart modal and verified its visibility",
      extractedData: {
        cartModalVisible,
        cartModalHeading
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
